import { test, expect } from '@playwright/test';

test('Navigate to Azure AI Foundry and check Model Catalogue', async ({ page }) => {
  // Navigate to the Azure AI Foundry overview page
  await page.goto('https://ai.azure.com/foundryProject/overview?wsid=/subscriptions/696debc0-8b66-4d84-87b1-39f43917d76c/resourceGroups/rg-t-schanda-8629/providers/Microsoft.CognitiveServices/accounts/playwright-pj-resource/projects/playwright_pj&tid=72f988bf-86f1-41af-91ab-2d7cd011db47', { waitUntil: 'networkidle' });

  // Verify the page title
  await expect(page).toHaveTitle(/Azure AI Foundry/);

  // Click on the "Model catalog" link
  await page.getByRole('link', { name: 'Model catalog' }).click();

  // Wait for the Model catalog page to load
  await page.waitForURL('https://ai.azure.com/resource/models?wsid=/subscriptions/696debc0-8b66-4d84-87b1-39f43917d76c/resourceGroups/rg-t-schanda-8629/providers/Microsoft.CognitiveServices/accounts/playwright-pj-resource/projects/playwright_pj&tid=72f988bf-86f1-41af-91ab-2d7cd011db47', { waitUntil: 'networkidle' });

  // Verify the page title
  await expect(page).toHaveTitle(/Model catalog - Azure AI Foundry/);

  // Check if the Azure OpenAI Model Catalogue is available
  const isModelCatalogueAvailable = await page.locator('text=Azure OpenAI').isVisible({ timeout: 10000 });
  expect(isModelCatalogueAvailable).toBeTruthy();

  // Close the browser
  await page.close();
});
